	var cardNumber = props.cardNumber ? props.cardNumber : ''

	return (
		<Card sx={{ minWidth: 275 }}>
		<CardContent>
			<Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>
				{'Word of the Day' + cardNumber}
